import './Expenses.css';
import ExpenseItem from "./ExpenseItem";

const Expenses = ({expenses}) => {
    const {id, date, title, amount} = expenses;

    return (
        <div className={'expenses'}>
            {expenses.map((expense) => (
                <ExpenseItem
                    key={id}
                    date={date}
                    title={title}
                    amount={amount}/>
            ))}
        </div>
    )
};

export default Expenses;
